import React, { Component } from 'react'
import axios from 'axios'
import Small_logo from "./images/Small_logo.jpg"
import "./timeline.css"
import history from '../history'
import TwitterLogo from  "./images/twitter.png"

export class timeline extends Component {
    constructor(props) {
        super(props)
        this.state = {
             token:localStorage.getItem("token"),
            // token2:localStorage.getItem("token"),
             showfollow:[],
             content:[],
             Error:"",
             username:"",
             error_message:""
        }
    }

    componentDidMount(){
        axios.post("http://127.0.0.1:8000/tweets/timeline/",this.state).then(response=>{
            console.log(response);
            if(response.status="200"){
                this.setState({content:response.data})
            }
            if(response.status="204"){
                this.setState({error_message:response.statusText})

            }

        }).catch(error=>{
            if(error.response.status="401"){
                this.setState({Error:error.response.data["message"]})
            }
            // if(error.response.status="204"){
            //     this.setState({error_message:error.response.stausText})
            // }
        })
    }
    DislayFollowers=()=>{
        axios.post("http://127.0.0.1:8000/followers/",this.state).then(response=>{
            console.log(response);
        }).catch(error=>{
            console.log(error.response);
        })
    //   this.setState({
    //       username
    //   })
    }
    DisplayFollowing=()=>{
        axios.post("http://127.0.0.1:8000/following/",this.state).then(response=>{
            console.log(response);
        }).catch(error=>{
            console.log(error.response);
        })
    }

    render() {
        const {content,Error,error_message,username}=this.state
        return (
            <div>
                <div className="leftpart">
                <div className="twitter_logo"><img src={TwitterLogo} ></img></div>  
            <br></br>
            <br></br>
            <br></br>
            <br></br>  
            <button className="change homebutton" onClick={()=>{history.push("/Timeline")}} ><i class="fa fa-home"></i>Home</button>
            <br></br>
            <br></br>
            <button className="change followeusersbutton"  onClick={()=>{history.push("/Follow")}}><i class="fa fa-list"></i>Follow Users</button>
            <br></br>
            <br></br>
            <button className="change followersbutton" onClick={()=>{history.push("/Followers")}} ><i class="fa fa-user-friends"></i>Followers</button>
            <br></br>
            <br></br>
            <button className="change followingbutton" onClick={()=>{history.push("/Followings")}}><i class="fa fa-user-plus"></i>Following</button>
            <br></br>
            <br></br>
            <button className="change profilebutton" onClick={()=>{history.push("/UserProfile")}}><i class="fa fa-user"></i>Profile</button>
            <br></br>
            <br></br>
            <button className="tweetbutton" onClick={()=>{history.push("/Tweets")}}>Tweet</button>
            </div> 
            <div className="rightpart">
            <div className="BottomPart">
            <h2>Home</h2>
            </div>

          <div className="timeline">{content.length? content.map(con=> <div><div key={con.id} className="timelinetext1"><div>{con.full_name} @{con.user_name}<div className="contentstyle">{con.content}
           <div className="bottomline"></div></div>
           </div></div>
           </div>):null}
           </div>


                </div> 

            </div>
        )
    }
}

export default timeline
